import React, { Fragment } from "react";
import { useState, useEffect } from "react";
import axios from "axios";
import "./home.css";
import "./nav.css";
import { useParams } from "react-router-dom";

export default function Chome() {
    const { date, company } = useParams();
    const [table, setTable] = useState([]);



    useEffect(() => {
        axios
            .get(`http://localhost:5000/api/company/${company}/${date}`)
            .then((res) => {
                setTable(res.data);
            })
            .catch((err) => {
                console.log(err);
            });
    }
    , [date, company]);

    return (
        <Fragment>
            <div className="nav">
                <div className="nav__left">
                    <h1>Stock Market</h1>
                </div>
                <div className="nav__right">
                    <a href="/">Home</a>
                    <a href="/company">Company</a>
                    <a href="/about">About</a>
                </div>
            </div>
            <div className="home">
                <div className="home__left">
                    <h1>Company</h1>
                    <h2>{company}</h2>
                    <h3>{date}</h3>
                </div>
                <div className="home__right">
                    <table>
                        <thead>
                            <tr>
                                <th>Company</th>
                                <th>Open</th>
                                <th>High</th>
                                <th>Low</th>
                                <th>Close</th>
                                <th>Volume</th>
                            </tr>
                        </thead>
                        <tbody>
                            {table.map((item) => (
                                <tr key={item.id}>
                                    <td>{item.company}</td>
                                    <td>{item.open}</td>
                                    <td>{item.high}</td>
                                    <td>{item.low}</td>
                                    <td>{item.close}</td>
                                    <td>{item.volume}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </div>
        </Fragment>
    );
}
